				"content": "The efficient management of our daily information in phys- ical and digital information spaces is a well-known prob- lem. Current research on personal information manage- ment (PIM) aims to understand and improve organisational and re-finding activities. We present a case study about organisational strategies in cross-media information spaces, consisting of physical as well as digital information. In con- trast to existing work, we provide a unified view on organi- sational strategies and investigate how re-finding cues differ across the physical and digital space. We further introduce a new mixing organisational strategy which is used in addi- tion to the well-known filing and piling strategies. Last but not least, based on the results of our study we discuss op- portunities and pitfalls for future descriptive PIM research and outline some directions for future PIM system design. Categories",
